nodes:
    - type: backgroundImage
      backgroundImage: MrSkopsStalactites
    - type: music
      musicId: VenomousMrSkops
    - type: speakers
      left:
          - MrSkops
      right:
          - Rayman
          - Betilla
          - Joe
    - type: dialog
      speaker: Joe
      text:
          ja-JP: お‘久‘ひさ‘しぶりですね、MR.Skops！お‘元気‘げんき‘ですか？
          en-US: ""
          he-IL: ""
      audio:
          ja-JP: bae2ff3476b57
    - type: dialog
      speaker: MrSkops
      shouldSpeakSlow: true
      text:
          ja-JP: ジョー‘殿‘どの‘！！！
          en-US: ""
          he-IL: ""
      audio:
          ja-JP: 581d222c0ad9f
    - type: dialog
      speaker: MrSkops
      shouldSpeakSlow: true
      text:
          ja-JP: お‘久‘ひさ‘しぶりですね!!!
          en-US: ""
          he-IL: ""
      audio:
          ja-JP: afbb020a6cd38
    - type: dialog
      speaker: MrSkops
      shouldSpeakSlow: true
      text:
          ja-JP: ‘皆様‘みなさま‘がどうしてここに‘来‘き‘たのか
          en-US: ""
          he-IL: ""
      audio:
          ja-JP: d2d052bcc677
    - type: dialog
      speaker: Rayman
      text:
          ja-JP: お‘前‘まえ‘の‘手伝‘てつだ‘いが‘必要‘ひつよう‘から
          en-US: ""
          he-IL: ""
      audio:
          ja-JP: eb2cea43c5861
    - type: dialog
      speaker: MrSkops
      shouldSpeakSlow: true
      text:
          ja-JP: そうか…
          en-US: ""
          he-IL: ""
      audio:
          ja-JP: c16e5adc784c6
    - type: music
      musicId: LurkingInTheDarkness
    - type: dialog
      speaker: MrSkops
      shouldSpeakSlow: true
      text:
          ja-JP: ‘何‘なに‘があったのか？
          en-US: ""
          he-IL: ""
      audio:
          ja-JP: 14778769b0dc
    - type: dialog
      speaker: Betilla
      text:
          ja-JP: ねースコプスさん、MR.　DARKの‘負‘ま‘けから、もう‘一年‘いちねん‘があったんだ
          en-US: ""
          he-IL: ""
      audio:
          ja-JP: 9a1f5b8abc87c
    - type: dialog
      speaker: MrSkops
      shouldSpeakSlow: true
      text:
          ja-JP: そうですのう…
          en-US: ""
          he-IL: ""
      audio:
          ja-JP: 1bcacd2bdaff2
    - type: dialog
      speaker: Rayman
      text:
          ja-JP: ‘皆‘みんな‘とパーティーを‘行‘おこな‘うつもりです
          en-US: ""
          he-IL: ""
      audio:
          ja-JP: 0323baa68d437
    - type: dialog
      speaker: Rayman
      text:
          ja-JP: よろしければ、パーティーに‘連‘つ‘れて‘行‘い‘きませんか？
          en-US: ""
          he-IL: ""
      audio:
          ja-JP: 6d3830934e54e
    - type: dialog
      speaker: MrSkops
      shouldSpeakSlow: true
      text:
          ja-JP: もちろんよ。‘皆‘みんな‘と‘一緒‘いっしょ‘にパーティーがいいらしいなあ
          en-US: ""
          he-IL: ""
      audio:
          ja-JP: 47ccde971748c

